class Team{
    constructor(name){
        this.name = name;
        this.pj = 0;
        this.g = 0;
        this.e = 0;
        this.p = 0;
        this.gf = 0;
        this.gc = 0;
        this.dg = 0;
        this.pts = 0;
        this.data = null;
    }

    addMatchInfo(data){
      this.data = data;
    }

    getName(){
      return this.name;
    }
}

export default Team;
